// SPDX-License-Identifier: MIT
pragma solidity ^0.8.30;

/// @notice Abstract base that provides major token aliasing for Chainlink Feed Registry
abstract contract ChainlinkAliasBase {
    // Chainlink registry sentinels
    address internal constant USD_SENTINEL = address(840);
    address internal constant ETH_SENTINEL = 0xEeeeeEeeeEeEeeEeEeEeeEEEeeeeEeeeeeeeEEeE;
    address internal constant BTC_SENTINEL = address(0xbBbBBBBbbBBBbbbBbbBbbbbBBbBbbbbBbBbbBBbB);

    // Common mainnet wrapped tokens
    address internal constant WETH_MAINNET = 0xC02aaA39b223FE8D0A0e5C4F27eAD9083C756Cc2;
    address internal constant WBTC_MAINNET = 0x2260FAC5E5542a773Aa44fBCfeDf7C193bc2C599;

    // Optional additional aliases provided by deployer
    mapping(address => address) internal baseAlias; // token -> canonical sentinel/base

    constructor(address[] memory aliases, address[] memory targets) {
        // Defaults
        baseAlias[WETH_MAINNET] = ETH_SENTINEL;
        baseAlias[WBTC_MAINNET] = BTC_SENTINEL;
        require(aliases.length == targets.length, "alias len");
        for (uint256 i = 0; i < aliases.length; i++) {
            baseAlias[aliases[i]] = targets[i];
        }
    }

    function _aliasBase(address base) internal view returns (address) {
        address aliased = baseAlias[base];
        return aliased == address(0) ? base : aliased;
    }
}

// SPDX-License-Identifier: MIT
pragma solidity ^0.8.30;

import {IDataBridge} from "../../../Core/interfaces/internal/IDataBridge.sol";
import {QuoteParams} from "../../../Core/structs/QuoteParams.sol";
import {IChainlinkFeedRegistry} from "../../../Core/interfaces/external/IChainlinkFeedRegistry.sol";
import {ChainlinkAliasBase} from "./ChainlinkAliasBase.sol";

/// @notice Chainlink-based bridge using Feed Registry to resolve USD feeds for assets
contract ChainlinkDataBridge is IDataBridge, ChainlinkAliasBase {
    address public immutable registry; // Chainlink Feed Registry

    constructor(address _registry, address[] memory aliases, address[] memory targets)
        ChainlinkAliasBase(aliases, targets)
    { registry = _registry; }

    // Returns abi.encode(spot1e18, updatedAtSeconds)
    function getData(QuoteParams memory params) external view override returns (bytes memory) {
        address b0 = _aliasBase(params.asset0);
        address b1 = _aliasBase(params.asset1);
        (uint256 p0, uint8 d0, uint256 u0) = _latestUsd(b0);
        (uint256 p1, uint8 d1, uint256 u1) = _latestUsd(b1);
        uint256 num = p0 * (10 ** (18 + d1));
        uint256 den = p1 * (10 ** d0);
        require(den != 0, "den=0");
        uint256 spot = num / den;
        uint256 updatedAt = u0 < u1 ? u0 : u1;
        return abi.encode(spot, updatedAt);
    }

    function _latestUsd(address base) internal view returns (uint256, uint8, uint256) {
        IChainlinkFeedRegistry r = IChainlinkFeedRegistry(registry);
        // First try base/USD
        try r.latestRoundData(base, USD_SENTINEL) returns (uint80, int256 answer, uint256, uint256 updatedAt, uint80) {
            require(answer > 0, "bad ans");
            uint8 dec = r.decimals(base, USD_SENTINEL);
            return (uint256(answer), dec, updatedAt);
        } catch {}
        // Fallback: USD/base (invert)
        try r.latestRoundData(USD_SENTINEL, base) returns (uint80, int256 answerInv, uint256, uint256 updatedAtInv, uint80) {
            require(answerInv > 0, "bad inv");
            uint8 decInv = r.decimals(USD_SENTINEL, base);
            uint256 tenPow = 10 ** decInv;
            uint256 p = (tenPow * tenPow) / uint256(answerInv);
            return (p, decInv, updatedAtInv);
        } catch {}
        revert("feed missing");
    }
}
